            "rek_grant_text": "Electron microscopy was performed in the Australian Microscopy and Microanalysis Facility (AMMRF) at the Centre for Microscopy and Microanalysis at the University of Queensland. We thank C. Breillat, D. Bouchet, B. Tessier, A. Frouin, L. Royer, and N. Retailleau for help in molecular biology and cell cultures. The GSDIM imaging was carried out in the Bordeaux Imaging Center of the University of Bordeaux Segalen with the help of Magali Mondin. We thank Rowan Tweedale for critical appraisal of the manuscript. CBH's travel to the Interdisciplinary Institute for Neuroscience in Bordeaux to carry out GSDIM imaging was supported by a Graduate Student International Travel Award (The University of Queensland). The work was supported by an Australian Research Council Discovery Project grant (DP120104057) and an Australian Research Council (ARC) Linkage Infrastructure Equipment and Facilities grant (LE130100078). FAM is a Senior Research Fellow of the NHMRC and was the recipient of a Queensland International Fellowship.",
