        "rek_formatted_abstract": "Exfoliation syndrome (XFS) is the most common recognizable cause of open-angle glaucoma worldwide. To better understand the etiology of XFS, we conducted a genome-wide association study (GWAS) of 1,484 cases and 1,188 controls from Japan and followed up the most significant findings in a further 6,901 cases and 20,727 controls from 17 countries across 6 continents. We discovered a genome-wide significant association between a new locus (<em>CACNA1A <\/em>rs4926244) and increased susceptibility to XFS (odds ratio (OR) = 1.16, P = 3.36 &times; 10<sup>&minus;11<\/sup>). Although we also confirmed overwhelming association at the <em>LOXL1 <\/em>locus, the key SNP marker (<em>LOXL1 <\/em>rs4886776) demonstrated allelic reversal depending on the ancestry group (Japanese: OR<sub>A allele<\/sub> = 9.87, P = 2.13 &times; 10<sup>&minus;217<\/sup>; non-Japanese: OR<sub>A allele<\/sub> = 0.49, P = 2.35 &times; 10<sup>&minus;31<\/sup>). Our findings represent the first genetic locus outside of <em>LOXL1 <\/em>surpassing genome-wide significance for XFS and provide insight into the biology and pathogenesis of the disease.",
