            "rek_grant_text": "This work was supported by project grant 1044014 and a Medical Research Council of Australia (Senior Research Fellowship 569596 to F.A.M.), the Australian Research Council (LIEF Grant LE0882864 to F.A.M.), and the University of Queensland (Postdoctoral Research Fellowship 2012001396 to T.W.). Electron microscopy was performed in the Australian Microscopy and Microanalysis Facility at the Centre for Microscopy and Microanalysis at the University of Queensland. The fabrication of the microfluidic devices was performed at the Queensland node of the Australian National Fabrication Facility, a company established under the National Collaborative Research Infrastructure Strategy to provide nanofabrication and microfabrication facilities for Australia's researchers. We thank the Bordeaux Imaging Center, part of the FranceBioImaging national infrastructure supported by the French National Research Agency (ANR-10-INSB-04); Rowan Tweedale for critical reading of the manuscript; and Rachel Gormal, Vanesa Tomatis, Luke Hammond, Victor Anggono, and Dusan Matusica for expert technical assistance.",
