            "rek_grant_text": "We thank Rowan Tweedale for critical reading of the manuscript, Robert Zorec (University of Ljubljana) for suggesting the correlation analysis, Martin Schwartz (Yale University) and Shuzo Sugita (University of Toronto) for the generous gift of vinculin TS and DKD-PC12 cells respectively. This research was supported by a project grant from the National Health and Medical Research Council (NHMRC) of Australia to F. A. M..; a Senior Research Fellowship from the NHMRC of Australia (569596 to F.A.M.); and an Australian Research Council LIEF grant to F.A.M. (LE0882864). A.S.Y. and G.A.G. were supported by grants (1037320, 1067405) and a research fellowship (1044041) from the NHMRC (Australia) and by the Kids Cancer Project of the Oncology Research Foundation. Confocal microscopy and laser nanoscissors were performed at the Australian Cancer Research Foundation\/Institute of Molecular Biology Cancer Biology Imaging Facility established with the generous support of the Australian Cancer Research Foundation.",
